def adjacency_mat_category(data, num_class = -1):

    data, rect = mp.MedicalImagePreprocess.ThresholdCrop(data, 8)

    w, h, l = data.shape
    sw, sh, sl = w - 2, h - 2, l - 2
    data_c = data[1: 1 + sw, 1: 1 + sh, 1: 1 + sl]

    all_pair = []
    hist_pair = {}
    data_edge = numpy.zeros_like(data_c)
    for w_n in range(0, 3):
        for h_n in range(0, 3):
            for l_n in range(0, 3):
                if w_n == h_n == l_n == 1:
                    continue
                data_t = data[w_n: w_n + sw, h_n: h_n + sh, l_n: l_n + sl]

                data_pair = numpy.concatenate([numpy.expand_dims(data_t, axis=-1), numpy.expand_dims(data_c, axis=-1)], axis=-1)
                all_pair.append(numpy.expand_dims(data_pair, axis=0))
                pass

    all_pair = numpy.concatenate(all_pair, axis=0)
    if num_class == -1:
        num_class = numpy.max(all_pair) + 1
    adjMat = numpy.zeros([num_class, num_class])
    all_pair = all_pair.reshape([-1, 2])

    adjMat, _, _ = numpy.histogram2d(all_pair[:, 0], all_pair[:, 1], bins=list(range(num_class + 1)))
    adjMat = adjMat + numpy.transpose(adjMat)
    # for p in all_pair:
    #     adjMat[p[0], p[1]] += 1
    #     adjMat[p[1], p[0]] += 1
    #
    # vv = numpy.sum(numpy.abs(adjMat - v))
    return adjMat

def adjacency_mat_cc(data, num_class = -1):


    w, h, l = data.shape
    if num_class == -1:
        num_class = numpy.max(data)

    w, h, l = data.shape
    sw, sh, sl = w - 2, h - 2, l - 2
    data_c = data[1: 1 + sw, 1: 1 + sh, 1: 1 + sl]


    data_edge = numpy.zeros_like(data_c)
    for w_n in range(0, 3):
        for h_n in range(0, 3):
            for l_n in range(0, 3):
                data_t = data[w_n: w_n + sw, h_n: h_n + sh, l_n: l_n + sl]
                data_edge = data_edge + ((data_c - data_t) != 0)


    data_c[data_edge == 0] = 0
    all_loc_m = [numpy.array(numpy.nonzero(data_c == i)).transpose() for i in range(1, num_class + 1)]

    for s_n in range(len(all_loc_m)):
        step = all_loc_m[s_n].shape[0] // 200
        all_loc_m[s_n] = all_loc_m[s_n] if step < 1 else all_loc_m[s_n][::step]


    adj_mat = numpy.zeros([num_class, num_class], data.dtype)
    for i in range(num_class):
        # loc_i = all_loc[i]
        for j in range(i + 1, num_class):
            # loc_j = all_loc[j]

            # li = numpy.tile(all_loc_m[i], (1, all_loc_m[j].shape[1]))
            # lj = numpy.repeat(all_loc_m[j], all_loc_m[i].shape[1], axis=1)
            # l = numpy.power(li - lj, 2)
            # l = numpy.sum(l, axis=0)
            # l = numpy.power(l, 0.5)
            # l = numpy.min(l)


            m = scipy.spatial.distance.cdist(all_loc_m[i], all_loc_m[j], metric='euclidean')
            l = numpy.min(m)
            # dis = 0 if i == j else min([ ((loc_i[0] - loc_j[0]) ** 2 +  (loc_i[1] - loc_j[1]) ** 2 + (loc_i[2] - loc_j[2]) ** 2) ** 0.5
            #         for loc_i in all_loc[i] for loc_j in all_loc[j]])

            adj_mat[i][j] = adj_mat[j][i] = 1. / l

    return adj_mat


def connected_component(data, connectivity):
    data_label = skimage.measure.label(data, connectivity=connectivity)
    data_prop = skimage.measure.regionprops(data_label)
    return data_label, data_prop


def reg_load_aff(aff_name):

    aff = []
    with open(aff_name, "r") as f:
        for l in f.readlines():
            l = l.strip("\n").split(" ")
            aff.append(l)

    return numpy.array(aff)

def reg_save_aff(aff_name, aff):

    with open(aff_name, "w") as f:
        for s in aff:
            ss = " ".join([str(v) for v in s])
            f.write(ss + "\n")

    pass



def reg_aladin(dst_path, src_path, save_path, interp = 2, rigonly = False, platf = 0, save_suffix = "", log = None, omp = -1,
            bin_path = "reg_aladin"):
    src_name = os.path.split(src_path)[-1]
    src_name = src_name.split(".")

    aff_name = os.path.join(save_path, src_name[0] + save_suffix + "_aff.txt")

    save_name = os.path.join(save_path, src_name[0] + save_suffix + ".nii.gz")

    cmd = bin_path + \
          " -ref " + dst_path + \
          " -flo " + src_path + \
          " -res " + save_name + \
          " -aff " + aff_name + \
          " -interp " + str(interp)

    cmd = cmd if rigonly is False else cmd + " -rigOnly "
    cmd = cmd + " -platf " + str(platf)
    cmd = cmd if omp < 0 else cmd + " -omp " + str(omp)
    cmd = cmd if log is None else cmd + " >>" + log

    print(cmd)
    v = os.system(cmd)
    assert(v == 0)
    return save_name, aff_name

def reg_f3d(dst_path, src_path, save_path, aff_path = None, interp = 2, save_suffix = "", log = None, omp = -1,
            bin_path = "reg_f3d"):
    src_name = os.path.split(src_path)[-1]
    src_name = src_name.split(".")
    save_name = os.path.join(save_path, src_name[0] + save_suffix + ".nii.gz")
    cpp_name = os.path.join(save_path, src_name[0] + save_suffix + "_cpp.nii.gz")

    cmd = bin_path + \
          " -ref " + dst_path + \
          " -flo " + src_path + \
          " -res " + save_name + \
          " -cpp " + cpp_name + \
          " -interp " + str(interp)

    cmd = cmd if aff_path is None else cmd + " -aff " + aff_path
    cmd = cmd if omp < 0 else cmd + " -omp " + str(omp)
    cmd = cmd if log is None else cmd + " >>" + log
    print(cmd)
    v = os.system(cmd)
    assert(v == 0)
    return save_name, cpp_name

